import axios from "axios";
import React, { useEffect, useState } from "react";
import { HomeContainer, ImagemPerfil, Perfil } from "./Styled";



export const HomePage = (props) => {
    const [profile, setPerfil] = useState({})

    useEffect(() => {
        getProfile
    }, [])

    const url = "https://us-central1-missao-newton.cloudfunctions.net/astroMatch/evertob-guedes-maryam/person"
    const getProfile = () => {
        axios.get(url)
            .then((response) => {
                setPerfil(response.data.profile)
            })
            .catch((error) => {
                console.log(error.response)
            })
    }

    return (
        <HomeContainer>
            <Perfil>
                <ImagemPerfil src={""} />
                <h1>{profile.name}</h1>
                <p>{profile.bio}</p>
                <div>
                    <button>X</button>
                    <button>O</button>
                </div>
            </Perfil>
            <div>
                <button onClick={props.irParaMatches}>Ir para Matches</button>
            </div>
        </HomeContainer>
    )
}
